      'body' => array(
        'und' => array(
          array(
            'value' => "<p>The <a href=\"https://www.isdc.unige.ch/integral/science/catalogue\" target=\"_blank\">ISDC general reference catalog</a> is used as a base for imaging, but for <a href=\"isgri-spectrum\">spectral</a> and light-curve extraction, it is suggested to prepare your own catalog based on the sources detected in the <a href=\"ibis-isgri-image-new-source\">image</a>.</p>\r\n\r\n<p>A catalog can be prepared based on templates that can be downloaded either in <a download=\"\" href=\"sites/all/modules/mmoda/data/catalog.txt\">ASCII</a> or <a download=\"\" href=\"sites/all/modules/mmoda/data/catalog.fits\">fits</a> format.</p>\r\n\r\n<p>Then, it is enough to upload it in the given window.</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/upload-catalog.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"215\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/upload-catalog.png?itok=pPLPYF7A\" width=\"480\" /> </a></p>\r\n",
            'summary' => '',
            'format' => 'full_html',
            'safe_value' => "<p>The <a href=\"https://www.isdc.unige.ch/integral/science/catalogue\" target=\"_blank\">ISDC general reference catalog</a> is used as a base for imaging, but for <a href=\"isgri-spectrum\">spectral</a> and light-curve extraction, it is suggested to prepare your own catalog based on the sources detected in the <a href=\"ibis-isgri-image-new-source\">image</a>.</p>\n\n<p>A catalog can be prepared based on templates that can be downloaded either in <a download=\"\" href=\"sites/all/modules/mmoda/data/catalog.txt\">ASCII</a> or <a download=\"\" href=\"sites/all/modules/mmoda/data/catalog.fits\">fits</a> format.</p>\n\n<p>Then, it is enough to upload it in the given window.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/upload-catalog.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"215\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/upload-catalog.png?itok=pPLPYF7A\" width=\"480\" /> </a></p>\n",
